local StackReplayTestingUtils = require("tests.StackReplayTestingUtils")
local tableUtils = require("tableUtils")

local function ghostGarbageTest()
  -- needs to be global because rollback doesn't happen for local matches
  local match = StackReplayTestingUtils.createVsMatch(10)
  -- errors out if no input is provided?
  match.P1:receiveConfirmedInput("")
  match.P2:receiveConfirmedInput("")

  -- get out of countdown
  -- simulateMatchUntil is disfunct when confirmedInputs are set so do it stack by stack
  StackReplayTestingUtils:simulateStack(match.P1, 250)
  StackReplayTestingUtils:simulateStack(match.P2, 250)

  match.P2.telegraph:push({width = 6, height = 2, isMetal = false, isChain = true}, 1, 1, match.P2.clock)
  -- ^ this will be received on the other stack when P2 reaches frame 340
  StackReplayTestingUtils:simulateStack(match.P1, 350)
  StackReplayTestingUtils:simulateStack(match.P2, 320)
  -- at this point in time, the chain garbage of P2 is not registered for P1 yet
  -- assume that P1 raises on frame 350 and gets a ghost combo
  match.P1.telegraph:push({width = 5, height = 1, isMetal = false, isChain = false}, 1, 1, match.P1.clock)
  -- ^ this will be received on the other stack at frame 410 with a target drop time of 470
  StackReplayTestingUtils:simulateStack(match.P1, 450)
  -- at this point in time the garbage of P1 should be in later_garbage of P2
  -- while the chain garbage of P2 has still not arrived for P1
  StackReplayTestingUtils:simulateStack(match.P2, 450)
  -- P1's combo should have gotten cancelled by the rollback here as we didn't repush
  assert(tableUtils.length(match.P1.later_garbage) == 0)

end

ghostGarbageTest()